import styled from "styled-components";

export const ContactContainer = styled.div`
  width: 750px;
  display: flex;
  justify-content: space-between;
  flex-direction: column;
`;

export const SignInAndSignUpContainer = styled.div`
  width: 850px;
  display: flex;
  justify-content: space-between;
  margin: 30px auto;
`;
